        */

    // ìœ„ì„ ë°›ì„ ë•Œ | #ğŸ“› ì´í•´ ì•ˆ ë¼
    mapping( address => mapping( address => uint ) ) public override allowance;
        /* ë§¤í•‘ ê°ì²´ ì•ˆì—, ë§¤í•‘ ê°ì²´ê°€ ìˆìŒ. 
            {
                "Aì£¼ì†Œ" : {
                    "Bì£¼ì†Œ" : 500 (ìœ„ì„ ë°›ì€ ì–‘ | 1000ê°œ ì¤‘ 500ê°œ ìœ„ì„)
