        // ë¯¼íŠ¸ë¥¼ ì‹¤í–‰í•˜ê³ , ì†Œìˆ˜ì  ë‹¨ìœ„ì— ë§ì¶°ì„œ ëŠì–´ì¤€ë‹¤? | ê·¸ëŸ¬ë©´, ì†Œìˆ˜ì  ë‹¨ìœ„ê°€ 18ê°œ ë¶™ì„ ê²ƒ
        mint(_amount * (10 ** uint256(decimals)) );

