        /* [í•´ì„]
        - string memory : ìŠ¤íŠ¸ë§ì€ ê°€ë³€ì ì´ê¸° ë•Œë¬¸ì—, memory ë¥¼ ë¶™ì—¬ì•¼ í•¨
        
        - msg.sender | 
            : ì—¬ê¸°ì—ì„œ, sender ë¼ëŠ” ë§ì€, ì´ë¯¸ ì¡´ì¬í•˜ëŠ” CA ì—ê²Œ, ë­”ê°€ë¥¼ ë³´ëƒˆë‹¤. ë¼ëŠ” ì˜ë¯¸? 
            : ì¦‰, ì—¬ê¸°ì—ì„œ msg ëŠ” íŠ¸ëœì­ì…˜ ì…ì¥ì—ì„œ, ë°›ê²Œ ë˜ë©´, ì´ê±° í• ê²Œ~ ë¼ëŠ” ì˜ë¯¸? 
