    // ëˆ„êµ°ê°€ì—ê²Œ, ë‚´ê°€ ê°–ê³  ìˆëŠ” í† í°ì„ ì „ì†¡ í•˜ê¸° 
    function transfer(address to, uint amount) external override returns(bool) {
