                        B : 50
                    }
                }

            // 50ê°œ ìœ„ì„í•˜ë©´ ????????
                {
                    A : 950
                    C : 50
                    
                }
        */
    }

    // ì–´ì œê²ƒ ë³´ê³  ì ê¸° 
    function burn (uint amount) external {
        balances[msg.sender] -= amount;
        totalSupply -= amount;
    }


}

